Every cafe has coffee that can perk you up. But if you want that extra warmth and coziness, come here.", 'time': 1695084946, 'translated': False}, {'author_name': 'Nurul Huda Azizol', 'author_url': 'https://www.google.com/maps/contrib/112134564914535493227/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocLt26iZchPRDRWpy14h_PjTq15VnA89ECIcRpyvKjCMBA=s128-c0x00000000-cc-rp-mo-ba3', 'rating': 5, 'relative_time_description': '6 months ago', 'text': 'Cafe interior is very nice. Love the vibe. Foods are great as always. Bagel is always my favorite. Good services too 👍🏻', 'time': 1683021143, 'translated': False}, {'author_name': 'Sidney Marshall', 'author_url': 'https://www.google.com/maps/contrib/102346008327397216883/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjU2Z9RL-XsqluaYFMkOukmxEjMy5hIXTJzPMHj42BviHAs=s128-c0x00000000-cc-rp-mo-ba4', 'rating': 5, 'relative_time_description': '8 months ago', 'text': 'came here by friends recommendation and it didn’t disappoint. I love the calm ambiance when its non peak hours. The bagles and papermint hot chocolate tasted like heavennnnn. Pleasant experience overall', 'time': 1676956520, 'translated': False}, {'author_name': 'Megan Goh', 'author_url': 'https://www.google.com/maps/contrib/109460122806704809976/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocJqVhgh1Ok8Oxjp6XKi5S57vRA6TL5ZWTwf_wAJhBX_=s128-c0x00000000-cc-rp-mo', 'rating': 5, 'relative_time_description': '5 months ago', 'text': 'Warm cozy place + friendly & helpful staffs, loving the vibes so far. Well recommended place to hangout.', 'time': 1685516077, 'translated': False}, {'author_name': 'Sookyee Hen', 'author_url': 'https://www.google.com/maps/contrib/100037773630092646955/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https:/