We also tried their seasonal Hummus with  Tortila Chips, it's good.", 'time': 1688369668, 'translated': False}, {'author_name': 'Melle Meelo', 'author_url': 'https://www.google.com/maps/contrib/114229671601412547066/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjXVei_oK53GrR3-_ufUiu7qUyyHDGmnScUNJzc4GE6f2WE=s128-c0x00000000-cc-rp-mo-ba2', 'rating': 5, 'relative_time_description': 'a year ago', 'text': 'I often here but never leave review until today. Went 30mins before 10am desprate looking for table to do my work. I was pushed away by kenny hillls baker upstairs didnt allowed me to wait cafe opening 10am at their table. Cbtl crew allowed me to sit at their cleaned table, after 10am i ordered and had my meal also ordered my first decaf latte from cbtl. Taste delicious. Thanks', 'time': 1666866362, 'translated': False}, {'author_name': 'Norsitah Masri', 'author_url': 'https://www.google.com/maps/contrib/106376280623872678101/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjVALb4fqg-NODF4zWZyh5rYEsaHg5FJWrIeDGFCcIDRwB4=s128-c0x00000000-cc-rp-mo-ba6', 'rating': 5, 'relative_time_description': '3 months ago', 'text': 'Dined on all in 1 bagel and cream fun choc bar. Drank cappuccino and mocha latte .', 'time': 1688717746, 'translated': False}, {'author_name': 'Alowe', 'author_url': 'https://www.google.com/maps/contrib/106789961875709828332/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjUuS0FCTqSFZJJ-285Q0YLMhP-bWg3JAlp8i4ZaEWscKlr5=s128-c0x00000000-cc-rp-mo-ba6', 'rating': 3, 'relative_time_description': 'a year ago', 'text': 'The cashier was very friendly and patient with the orders. The drinks were OK but still a tad sweet.  There was a lump of chai pre mix at the bottom of my cup . The cakes in the fridge display was dry . The ones outside were fine . The gula melaka cake was super sweet for my liking and too dry.  The Chicago cheese cake was better that day compared to the Gula melaka cake and the Carrot cake was still the best out of the 3 cause it was moist . The ratings were only for that probably things would have been better if it was fresh .', 'time': 1651114008, 'translated': False}], 'serves_breakfast': True, 'serves_brunch': True, 'serves_lunch': True, 'takeout': True, 'types': ['cafe', 'point_of_interest', 'food', 'establishment'], 'url': 'https://maps.google.com/?cid=11327108806671064910', 'user_ratings_total': 47, 'utc_offset': 480, 'vicinity': 'LG-02, KL East Mall, off, Jalan Lingkaran Tengah 2', 'website': 'https://www.coffeebean.com.my/'}

