ge': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjXZHAgH1wcJerWNNAqCvioCb4VIrVXo3BSrW91fzLLof8E=s128-c0x00000000-cc-rp-mo-ba4', 'rating': 5, 'relative_time_description': '2 months ago', 'text': 'We are here for morning coffee and to try out the beans. We like “New Wave Sweet” beans. We didn’t have any cake so no comments on that. Recommend for the coffee and their friendly service.', 'time': 1691850176, 'translated': False}, {'author_name': 'The Traveller', 'author_url': 'https://www.google.com/maps/contrib/114964800393148239181/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocLHTvyLxAW0UYym_OKpqWPlYNQmVTRF_BZGKwSJrGgU=s128-c0x00000000-cc-rp-mo-ba4', 'rating': 5, 'relative_time_description': 'a month ago', 'text': 'Food n coffee is great with reasonable price. Open space Parking is available 3-4 min walk. Good to chill up with friends n family for morning or afternoon tea.', 'time': 1693826364, 'translated': False}, {'author_name': 'LenaLee Ivy', 'author_url': 'https://www.google.com/maps/contrib/116224634544060948572/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjXytxMBlvBc6tyDlEKWw5sGLM_xr2Jv38UHcqc99yrTw3E=s128-c0x00000000-cc-rp-mo-ba4', 'rating': 5, 'relative_time_description': '6 months ago', 'text': "My friend and I were searching for a cafe where it serves the sponge cake with ice cream during our visit at Penang (we didn't know the cafe's name as we only saw a photo of it posted in FB). Otw going back to work from lunch, we stumbled this cafe and noticed the background of the cafe is similar to the photo posted in FB. Thus, we went in and ask the cafe's staff.

This cafe indeed served sponge cake with ice cream! However, the pandan cake were only available on Friday. We had the orange sponge cake & cempedak cheesecakes. The cakes were delicious and coffee were aromatic. I think they also sell coffee beans as they got roastery inside the cafe.

We then went back to this cafe on Friday for the pandan sponge cake + ice cream. Didn't disappoint us! Totally come back for its sponge cake & coffee! Cozy yet chill cafe.", 'time': 1683014743, 'translated': False}, {'author_name': 'Henry Christian', 'author_url': 'https://www.google.com/maps/contrib/115131263219786984291/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjXQTtQEK0llWj50zQ50ai2c1gNIe7YZQabnpnxNXhhZ3do=s128-c0x00000000-cc-rp-mo-ba5', 'rating': 4, 'relative_time_description': '6 months ago', 'text': "The burnt basque cheesecake is to die for. I'm surprised to find such a high-quality cheesecake in this cafe. It's creamy, smooth, rich, but light. I paired it with a glass of iced long black, oh it was heavenly.", 'time': 1681650801, 'translated': False}], 'serves_beer': False, 'serves_breakfast': True, 'serves_brunch': False, 'serves_lunch': True, 'serves_vegetarian_food': False, 'takeout': True, 'types': ['cafe', 'point_of_interest', 'food', 'store', 'establishment'], 'url': 'https://maps.google.com/?cid=16547981165747589018', 'user_ratings_total': 436, 'utc_offset': 480, 'vicinity': '435, Lebuh Chulia, George Town', 'website': 'https://coffee-lane2009.business.site/'}

