 gula melaka cake was super sweet for my liking and too dry.  The Chicago cheese cake was better that day compared to the Gula melaka cake and the Carrot cake was still the best out of the 3 cause it was moist . The ratings were only for that probably things would have been better if it was fresh .', 'time': 1651114008, 'translated': False}], 'serves_breakfast': True, 'serves_brunch': True, 'serves_lunch': True, 'takeout': True, 'types': ['cafe', 'food', 'point_of_interest', 'establishment'], 'url': 'https://maps.google.com/?cid=11327108806671064910', 'user_ratings_total': 47, 'utc_offset': 480, 'vicinity': 'LG-02, KL East Mall, off, Jalan Lingkaran Tengah 2', 'website': 'https://www.coffeebean.com.my/'}

