ext': "If there's an award for the best ID or decor among all restaurants in the entire Sentul Point, it has to deservedly go to Coffee Bean. There's so so so much effort put into it.

Even the flooring as well that has 1950s mood. Great job to whoever that came up with this idea and execute it. I love the curved lighting on the wall. For some reasons it is giving me the Scandinavian vibe. Super luvvvvv that.

Every cafe has coffee that can perk you up. But if you want that extra warmth and coziness, come here.", 'time': 1695084946, 'translated': False}, {'author_name': 'Nurul Huda Azizol', 'author_url': 'https://www.google.com/maps/contrib/112134564914535493227/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocLt26iZchPRDRWpy14h_PjTq15VnA89ECIcRpyvKjCMBA=s128-c0x00000000-cc-rp-mo-ba3', 'rating': 5, 'relative_time_description': '6 months ago', 'text': 'Cafe interior is very nice. Love the vibe. Foods are great as always. Bagel is always my favorite. Good services too 👍🏻', 'time': 1683021143, 'translated': False}, {'author_name': 'Sidney Marshall', 'author_url': 'https://www.google.com/maps/contrib/102346008327397216883/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjU2Z9RL-XsqluaYFMkOukmxEjMy5hIXTJzPMHj42BviHAs=s128-c0x00000000-cc-rp-mo-ba4', 'rating': 5, 'relative_time_description': '8 months ago', 'text': 'came here by friends recommendation and it didn’t disappoint. I love the calm ambiance when its non peak hours. The bagles and papermint hot chocolate tasted like heavennnnn. Pleasant experience overall', 'time': 1676956520, 'translated': False}, {'author_name': 'Megan Goh', 'author_url': 'https://www.google.com/maps/contrib/109460122806704809976/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocJqVhgh1Ok8Oxjp6XKi5S57vRA6TL5ZWTwf_wAJhBX_=s128-c0x00000000-cc-rp-mo', 'rating': 5, 'relative_time_description': '5 months ago', 'text': 'Warm cozy place + friendly & helpful staffs, loving the vibes so far. Well recommended place to hangout.', 'time': 1685516077, 'translated': False}, {'author_name': 'Sookyee Hen', 'author_url': 'https://www.google.com/maps/contrib/100037773630092646955/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjUFt3733bRXAWGnV48tPsN9aG0-BZn6t4M_2-d5rWYX6zY=s128-c0x00000000-cc-rp-mo', 'rating': 3, 'relative_time_description': '7 months ago', 'text': 'Portion getting smaller and smaller, one set RM28 but salad no longer comes with cranberry and almond flakes', 'time': 1680042648, 'translated': False}], 'serves_breakfast': True, 'serves_lunch': True, 'takeout': True, 'types': ['cafe', 'store', 'food', 'point_of_interest', 'establishment'], 'url': 'https://maps.google.com/?cid=7531280294945428889', 'user_ratings_total': 78, 'utc_offset': 480, 'vicinity': 'AG-20, Ground Floor, Puncak Sentul, 8, Jalan Sentul Pasar, Sentul, Kuala Lumpur', 'website': 'https://www.coffeebean.com.my/'}
